package main import ( "context" "log" hellov1 "github.com/crrow/rsketch/gen/go/hello/v1" "google.golang.org/grpc" "google.golang.org/grpc/credentials/insecure" "google.golang.org/protobuf/types/known/emptypb"
) func main() { // Connect to the Rust gRPC server conn, err := grpc.Dial("localhost:50051", grpc.WithTransportCredentials(insecure.NewCredentials())) if err != nil { log.Fatal(err) } defer conn.Close() // Create client (generated code contains only client) client := hellov1.NewHelloServiceClient(conn) resp, err := client.Hello(context.Background(), &emptypb.Empty{}) if err != nil { log.Fatal(err) } log.Printf("Response: %v", resp)
}

