import com.rsketch.api.hello.v1.HelloGrpc;
import io.grpc.ManagedChannel;
import io.grpc.ManagedChannelBuilder;
import com.google.protobuf.Empty; public class HelloClient { public static void main(String[] args) { // Connect to the Rust gRPC server ManagedChannel channel = ManagedChannelBuilder .forAddress("localhost", 50051) .usePlaintext() .build(); // Create client (generated code contains only client) HelloGrpc.HelloBlockingStub stub = HelloGrpc.newBlockingStub(channel); Empty response = stub.hello(Empty.getDefaultInstance()); System.out.println("Response: " + response); channel.shutdown(); }
}

