#include <grpcpp/grpcpp.h>
#include "hello/v1/hello.grpc.pb.h"
#include <google/protobuf/empty.pb.h> using grpc::Channel;
using grpc::ClientContext;
using grpc::Status;
using rsketch::hello::v1::Hello;
using google::protobuf::Empty; class HelloClient {
public: HelloClient(std::shared_ptr<Channel> channel) : stub_(Hello::NewStub(channel)) {} void SayHello() { Empty request; Empty response; ClientContext context; // Call the Rust gRPC server Status status = stub_->Hello(&context, request, &response); if (status.ok()) { std::cout << "Hello successful" << std::endl; } else { std::cout << "Hello failed: " << status.error_message() << std::endl; } } private: std::unique_ptr<Hello::Stub> stub_; // Client stub only
}; int main() { // Connect to the Rust gRPC server auto channel = grpc::CreateChannel("localhost:50051", grpc::InsecureChannelCredentials()); HelloClient client(channel); client.SayHello(); return 0;
}
